import React from "react";
import defaultAvatar from "../../../../../component/Layout/assets/avatar-user.png";
import Avatar from "@mui/material/Avatar";

export default function GroupListItem({ group }) {
  const avatarStyles = {
    m: 1,
    border: 2,
    borderColor: "#808080",
  };
  return (
    <>
      <li className="GroupListItem">
        <Avatar
          src={group.picture || defaultAvatar}
          alt={group.username}
          sx={{
            ...avatarStyles,
          }}
        />
        <div className="UserListItemName">{group.name || "no name"}</div>
      </li>
    </>
  );
}
